import React from "react";
import { Home } from "./home/home";
import {BrowserRouter as Router, Switch, Route, Link, useRouteMatch, useParams} from "react-router-dom"


export const Main = () => {
  return(
    <Switch>
      <Route path="/">
        <Home/>
      </Route>
    </Switch>
    
  )
}
